import './App.css';
import { useQuery } from '@tanstack/react-query';
import { readCoinsQuery } from './queries/readCoins';
import { CoinDto } from './api-client'; // falls dein Generator CoinDto exportiert

function App() {
  const { data, isLoading, error } = useQuery(readCoinsQuery);

  if (isLoading) return <p>Loading...</p>;
  if (error instanceof Error) return <p>Error: {error.message}</p>;

  return (
      <div>
        <h1>Coin List</h1>
        <ul>
          {data?.map((coin: CoinDto) => (
              <li key={coin.id}>
                <strong>{coin.name}</strong> ({coin.symbol}) â€“ {coin.id} $
              </li>
          ))}
        </ul>
      </div>
  );
}

export default App;
